textOriginal:
Estava no teu aguardo nobre Thiago.

Amanhã, cada brasileira e cada brasileiro, na hora do voto, será igual...
Amanhã, cada brasileira e cada brasileiro terá a oportunidade de ser o procurador geral da república para avaliar os dados da CPI da Covid, que, segundo a ciência, poderia ter 400 mil pessoas ainda vivas no País, ou seja, poderá lembrar de cada avó, avô mãe, pai, tia, tio, filha, filho, prima, primo, cilega de trabalho, vizinha e vizinho que poderia estar à mesa com sua família;
Amanhã, cada brasileira e cada brasileiro poderá ser o presidente da câmara dos deputados e julgar os 150 pedidos de impeachman;
Amanhã, cada brasileira e cada brasileiro, independentemente, de morar num barraco ou na Faria Lima, terá o mesmo valor...

Randolfe Rodrigues, Senador da República
